def __getitem__(self, key):
    key = com.apply_if_callable(key, self)
    try:
        result = self.index.get_value(self, key)
        if not is_scalar(result):
            if is_list_like(result) and (not isinstance(result, Series)):
                try:
                    if not is_scalar(self.index.get_loc(key)):
                        result = self._constructor(result, index=[key] * len(result), dtype=self.dtype).__finalize__(self)
                except KeyError:
                    pass
        return result
    except InvalidIndexError:
        pass
    except (KeyError, ValueError):
        if isinstance(key, tuple) and isinstance(self.index, MultiIndex):
            pass
        elif key is Ellipsis:
            return self
        elif com.is_bool_indexer(key):
            pass
        else:
            new_key = self.index._convert_scalar_indexer(key, kind='getitem')
            if type(new_key) != type(key):
                return self.__getitem__(new_key)
            raise
    except Exception:
        raise
    if is_iterator(key):
        key = list(key)
    if com.is_bool_indexer(key):
        key = check_bool_indexer(self.index, key)
    return self._get_with(key)

def _get_with(self, key):
    if isinstance(key, slice):
        return self._slice(key)
    elif isinstance(key, ABCDataFrame):
        raise TypeError('Indexing a Series with DataFrame is not supported, use the appropriate DataFrame column')
    elif isinstance(key, tuple):
        try:
            return self._get_values_tuple(key)
        except Exception:
            if len(key) == 1:
                key = key[0]
                if isinstance(key, slice):
                    return self._get_values(key)
            raise
    if not isinstance(key, (list, np.ndarray, Series, Index)):
        key = list(key)
    if isinstance(key, Index):
        key_type = key.inferred_type
    else:
        key_type = lib.infer_dtype(key, skipna=False)
    if key_type == 'integer':
        if self.index.is_integer() or self.index.is_floating():
            return self.loc[key]
        else:
            return self._get_values(key)
    elif key_type == 'boolean':
        return self._get_values(key)
    if isinstance(key, (list, tuple)):
        if len(key) == 1 and isinstance(key[0], slice):
            return self._get_values(key)
        return self.loc[key]
    return self.reindex(key)

def _get_values_tuple(self, key):
    if com.any_none(*key):
        return self._get_values(key)
    if not isinstance(self.index, MultiIndex):
        raise ValueError('Can only tuple-index with a MultiIndex')
    indexer, new_index = self.index.get_loc_level(key)
    return self._constructor(self._values[indexer], index=new_index).__finalize__(self)

