def __getitem__(self, key):
    key = com.apply_if_callable(key, self)
    try:
        result = self.index.get_value(self, key)

        if not is_scalar(result):
            if is_list_like(result) and not isinstance(result, Series):

                # we need to box if loc of the key isn't scalar here
                # otherwise have inline ndarray/lists
                try:
                    if not is_scalar(self.index.get_loc(key)):
                        result = self._constructor(
                            result, index=[key] * len(result), dtype=self.dtype
                        ).__finalize__(self)
                except KeyError:
                    pass
        return result
    except InvalidIndexError:
        pass
    except (KeyError, ValueError):
        if isinstance(key, tuple) and isinstance(self.index, MultiIndex):
            # kludge
            pass
        elif key is Ellipsis:
            return self
        elif com.is_bool_indexer(key):
            pass
        else:

            # we can try to coerce the indexer (or this will raise)
            new_key = self.index._convert_scalar_indexer(key, kind="getitem")
            if type(new_key) != type(key):
                return self.__getitem__(new_key)
            raise

    except Exception:
        raise

    if is_iterator(key):
        key = list(key)

    if com.is_bool_indexer(key):
        key = check_bool_indexer(self.index, key)

    return self._get_with(key)

def _get_with(self, key):
    # other: fancy integer or otherwise
    if isinstance(key, slice):
        return self._slice(key)
    elif isinstance(key, ABCDataFrame):
        raise TypeError(
            "Indexing a Series with DataFrame is not "
            "supported, use the appropriate DataFrame column"
        )
    elif isinstance(key, tuple):
        try:
            return self._get_values_tuple(key)
        except Exception:
            if len(key) == 1:
                key = key[0]
                if isinstance(key, slice):
                    return self._get_values(key)
            raise

    if not isinstance(key, (list, np.ndarray, Series, Index)):
        key = list(key)

    if isinstance(key, Index):
        key_type = key.inferred_type
    else:
        key_type = lib.infer_dtype(key, skipna=False)

    if key_type == "integer":
        if self.index.is_integer() or self.index.is_floating():
            return self.loc[key]
        else:
            return self._get_values(key)
    elif key_type == "boolean":
        return self._get_values(key)

    if isinstance(key, (list, tuple)):
        # TODO: de-dup with tuple case handled above?
        # handle the dup indexing case GH#4246
        if len(key) == 1 and isinstance(key[0], slice):
            # [slice(0, 5, None)] will break if you convert to ndarray,
            # e.g. as requested by np.median
            # FIXME: hack
            return self._get_values(key)

        return self.loc[key]

    return self.reindex(key)

def _get_values_tuple(self, key):
    # mpl hackaround
    if com.any_none(*key):
        return self._get_values(key)

    if not isinstance(self.index, MultiIndex):
        raise ValueError("Can only tuple-index with a MultiIndex")

    # If key is contained, would have returned by now
    indexer, new_index = self.index.get_loc_level(key)
    return self._constructor(self._values[indexer], index=new_index).__finalize__(
        self
    )

def _get_values(self, indexer):
    try:
        return self._constructor(
            self._data.get_slice(indexer), fastpath=True
        ).__finalize__(self)
    except Exception:
        return self._values[indexer]

def __setitem__(self, key, value):
    key = com.apply_if_callable(key, self)
    cacher_needs_updating = self._check_is_chained_assignment_possible()

    try:
        self._set_with_engine(key, value)
    except com.SettingWithCopyError:
        raise
    except (KeyError, ValueError):
        values = self._values
        if is_integer(key) and not self.index.inferred_type == "integer":
            values[key] = value
        elif key is Ellipsis:
            self[:] = value
        else:
            self.loc[key] = value

    except TypeError as e:
        if isinstance(key, tuple) and not isinstance(self.index, MultiIndex):
            raise ValueError("Can only tuple-index with a MultiIndex")

        # python 3 type errors should be raised
        if _is_unorderable_exception(e):
            raise IndexError(key)

        if com.is_bool_indexer(key):
            key = check_bool_indexer(self.index, key)
            try:
                self._where(~key, value, inplace=True)
                return
            except InvalidIndexError:
                pass

        self._set_with(key, value)

    if cacher_needs_updating:
        self._maybe_update_cacher()

def _set_with_engine(self, key, value):
    values = self._values
    if is_extension_array_dtype(values.dtype):
        # The cython indexing engine does not support ExtensionArrays.
        values[self.index.get_loc(key)] = value
        return
    try:
        self.index._engine.set_value(values, key, value)
        return
    except KeyError:
        values[self.index.get_loc(key)] = value
        return

def _set_with(self, key, value):
    # other: fancy integer or otherwise
    if isinstance(key, slice):
        indexer = self.index._convert_slice_indexer(key, kind="getitem")
        return self._set_values(indexer, value)

    elif is_scalar(key) and not is_integer(key) and key not in self.index:
        # GH#12862 adding an new key to the Series
        # Note: have to exclude integers because that is ambiguously
        #  position-based
        self.loc[key] = value
        return

    else:
        if isinstance(key, tuple):
            try:
                self._set_values(key, value)
            except Exception:
                pass

        if is_scalar(key):
            key = [key]
        elif not isinstance(key, (list, Series, np.ndarray)):
            try:
                key = list(key)
            except Exception:
                key = [key]

        if isinstance(key, Index):
            key_type = key.inferred_type
            key = key._values
        else:
            key_type = lib.infer_dtype(key, skipna=False)

        if key_type == "integer":
            if self.index.inferred_type == "integer":
                self._set_labels(key, value)
            else:
                return self._set_values(key, value)
        elif key_type == "boolean":
            self._set_values(key.astype(np.bool_), value)
        else:
            self._set_labels(key, value)

def _set_values(self, key, value):
    if isinstance(key, Series):
        key = key._values
    self._data = self._data.setitem(indexer=key, value=value)
    self._maybe_update_cacher()

